    {
        families = FamilyMembersService.GetFamilies();
        adults = FamilyMembersService.GetAdults();
        adultsToShow = adults;
        familiesToShow = families;
    }
    
    private void showAllFamilies()
    {
        NavigationManager.NavigateTo("/families");
    }
    
